import { Button, Container, Menu } from "semantic-ui-react";
import { NavLink } from "react-router-dom";
import logo from './logo.jpg'; 
import './Header.css';

export default function NavBar() {
    return (
        <Menu inverted fixed="top" style={{ padding: "0.7rem 0", background: "#1b1c1d" }}>
            <Container className="header-container" style={{ display: "flex", alignItems: "center" }}>
                
                <Menu.Item 
                    as={NavLink} 
                    to="/" 
                    header 
                    style={{ display: "flex", alignItems: "center" }}
                >
                    <img 
                        src={logo} 
                        alt="logo" 
                        className="header-logo"
                        style={{
                            width: "45px",
                            height: "45px",
                            objectFit: "cover",
                            borderRadius: "8px",
                            marginRight: "12px"
                        }}
                    />
                    <span style={{ fontSize: "1.2rem", fontWeight: "600" }}>CarShop</span>
                </Menu.Item>

                <Menu.Menu position="right">
                    <Menu.Item as={NavLink} to="/cars">
                        <Button
                            content="Wszystkie Auta"
                            size="large"
                            style={{
                                borderRadius: "30px",
                                padding: "12px 26px",
                                fontSize: "1rem",
                                fontWeight: "600",
                                transition: "0.2s",
                                background: "#2185d0",
                                color: "white"
                            }}
                            
                        />
                    </Menu.Item>
                </Menu.Menu>
            </Container>
        </Menu>
    );
}
